Templates.template:
isPersonalized(
	{
		appComponent: ${appComponent}, // sap.ui.core.Component
		id: "${id}" // string
	},
	"${aChangeTypes}" // array
)

resetChanges(
	{
		appComponent: ${appComponent}, // sap.ui.core.Component
		id: "${id}" // string
	},
	"${aChangeTypes}" // String[]
)

create_app_addAnnotationsToOData(
	{
		dataSourceId: "${dataSourceId}", // string
		annotations: [${annotations}], // array
		annotationsInsertPosition: ${annotationsInsertPosition}, // sap.ui.fl.descriptorRelated.api.AnnotationsInsertPositionType
		dataSource: ${dataSource} // object
	}
)

create_app_changeInbound(
	{
		inboundId: "${inboundId}", // string
		entityPropertyChange: [${entityPropertyChange}] // object|array
	},
	"${mTexts}" // object
)

create_app_setDescription(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	},
	"${mTexts}" // object
)

create_app_setInfo(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	}
)

create_app_setShortTitle(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	},
	"${mTexts}" // object
)

create_app_setSubTitle(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	},
	"${mTexts}" // object
)

create_app_setTitle(
	{
		maxLength: ${maxLength}, // object
		type: ${type}, // object
		comment: ${comment}, // object
		value: ${value} // object
	},
	"${mTexts}" // object
)

create_ovp_addNewCard(
	{
		card: ${card}, // object
		model: ${model}, // object
		dataSource: ${dataSource} // object
	},
	"${mTexts}" // object
)

create_ovp_changeCard(
	{
		cardId: "${cardId}", // string
		entityPropertyChange: [${entityPropertyChange}] // object|array
	},
	"${mTexts}" // object
)

createAppVariant(
	{
		reference: "${reference}", // string
		id: "${id}", // string
		version: "${version}", // string
		layer: "${layer}", // string
		skipIam: ${bSkipIam} // boolean
	}
)

createNew(
	{
		reference: "${reference}", // string
		id: "${id}", // string
		version: "${version}", // string
		layer: "${layer}", // string
		skipIam: ${bSkipIam} // boolean
	}
)

instantiateFragment(
	"${oChange}", // sap.ui.fl.Change
	{
		modifier: ${modifier}, // sap.ui.core.util.reflection.BaseTreeModifier
		appComponent: ${appComponent}, // object
		view: ${view} // object
	}
)

fireSave(
	{
		name: "${name}", // string
		overwrite: ${bOverwrite}, // boolean
		key: "${key}", // string
		execute: ${bExecute}, // boolean
		def: ${bDef} // boolean
	}
)

load(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		containerKey: "${containerKey}", // string
		itemName: "${itemName}" // string
	}
)

new sap.ui.fl.write._internal.appVariant.AppVariant(
	{
		id: "${id}", // string
		reference: "${reference}", // string
		transport: "${transport}", // string
		package: "${package}", // string
		version: "${version}", // string
		layer: "${layer}" // string
	}
)

load(
	{
		id: "${id}", // string
		transport: "${transport}", // string
		isForSmartBusiness: "${isForSmartBusiness}", // string
		layer: "${layer}" // string
	}
)

prepareDelete(
	{
		id: "${id}", // string
		transport: "${transport}", // string
		isForSmartBusiness: "${isForSmartBusiness}", // string
		skipIam: ${bSkipIam} // boolean
	}
)

prepareUpdate(
	{
		id: "${id}", // string
		transport: "${transport}", // string
		isForSmartBusiness: "${isForSmartBusiness}", // string
		skipIam: ${bSkipIam} // boolean
	}
)

assignCatalogs(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		layer: ${layer}, // sap.ui.fl.Layer
		assignFromAppId: "${assignFromAppId}", // string
		action: "${action}" // string
	}
)

saveAs(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		id: "${id}", // string
		layer: ${layer} // sap.ui.fl.Layer
	}
)

unassignCatalogs(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		layer: ${layer}, // sap.ui.fl.Layer
		action: "${action}" // string
	}
)

apply(
	{
		change: ${change}, // sap.ui.fl.Change
		element: ${element}, // sap.ui.core.Element
		modifier: ${modifier}, // sap.ui.core.util.reflection.BaseTreeModifier
		appDescriptor: ${appDescriptor} // object
	}
)

buildSelectorFromElementIdAndType(
	{
		element: ${element}, // sap.ui.core.Element
		elementId: "${elementId}", // string
		elementType: "${elementType}" // string
	}
)

hasHigherLayerChanges(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		upToLayer: "${upToLayer}", // string
		ignoreMaxLayerParameter: ${bIgnoreMaxLayerParameter} // boolean
	}
)

reset(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		layer: "${layer}", // string
		generator: "${generator}", // string
		selectorIds: [${selectorIds}], // string[]
		changeTypes: [${changeTypes}] // string[]
	}
)

save(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		skipUpdateCache: ${bSkipUpdateCache}, // boolean
		transport: "${transport}", // string
		layer: "${layer}", // string
		draft: ${bDraft} // boolean
	}
)

create(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		id: "${id}", // string
		layer: ${layer}, // sap.ui.fl.Layer
		transport: "${transport}", // string
		package: "${package}", // string
		version: "${version}" // string
	}
)

create(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		containerKey: "${containerKey}", // string
		itemName: "${itemName}", // string
		content: "${content}", // string
		category: "${category}", // string
		containerCategory: "${containerCategory}" // string
	}
)

deletePersonalization(
	{
		selector: ${selector}, // sap.ui.fl.Selector
		reference: "${reference}", // string
		containerKey: "${containerKey}", // string
		itemName: "${itemName}" // string
	}
)
